import "./HeroRestStyles.css";
import React, { Component } from "react";

class HeroRest extends Component {
  render() {
    return (
      <div className="herorest">
        <div className="heading">
          <h1>{this.props.heading}</h1>
          <p>{this.props.text}</p>
        </div>
      </div>
    );
  }
}

export default HeroRest;
